    ["2001101"]={id=2001101,name="【法尼亚秘书】（昂？啊！）你来了啊，导师。",loopType=1,cuename="v_faniya_s_02",sheetName="media/audio/CV/Role/Faniya/v_faniya_system",sheetNameawb="media/audio/CV/Role/Faniya/v_faniya_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2001102"]={id=2001102,name="【法尼亚秘书】唔嘿，真的没办法碰到云层啊……（叹气：哈——）啊！导师您什么时候来的？",loopType=1,cuename="v_faniya_s_03",sheetName="media/audio/CV/Role/Faniya/v_faniya_system",sheetNameawb="media/audio/CV/Role/Faniya/v_faniya_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2001103"]={id=2001103,name="【法尼亚秘书】源能海的浪真漂亮啊，导师。",loopType=1,cuename="v_faniya_s_04",sheetName="media/audio/CV/Role/Faniya/v_faniya_system",sheetNameawb="media/audio/CV/Role/Faniya/v_faniya_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2001104"]={id=2001104,name="【法尼亚秘书】尼伯龙根号上有很多很黑的地方，（唔——）那些地方究竟藏着什么呢。",loopType=1,cuename="v_faniya_s_05",sheetName="media/audio/CV/Role/Faniya/v_faniya_system",sheetNameawb="media/audio/CV/Role/Faniya/v_faniya_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2001105"]={id=2001105,name="【法尼亚秘书】（裹紧自己的衣服，察觉到了一丝凉意）（呼——）在这里待久了会着凉的，导师，我们去船舱里面吧……（嗯？）导师？",loopType=1,cuename="v_faniya_s_06",sheetName="media/audio/CV/Role/Faniya/v_faniya_system",sheetNameawb="media/audio/CV/Role/Faniya/v_faniya_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2001106"]={id=2001106,name="【法尼亚秘书】（叹气）不知道天空的上方又会是怎样的景象呢？",loopType=1,cuename="v_faniya_s_07",sheetName="media/audio/CV/Role/Faniya/v_faniya_system",sheetNameawb="media/audio/CV/Role/Faniya/v_faniya_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2001107"]={id=2001107,name="【法尼亚秘书】（轻笑：哼哼）偶尔能像这样稍微放松一下，似乎也不错嘛~",loopType=1,cuename="v_faniya_s_08",sheetName="media/audio/CV/Role/Faniya/v_faniya_system",sheetNameawb="media/audio/CV/Role/Faniya/v_faniya_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2001108"]={id=2001108,name="【法尼亚秘书】那里的光（——），无论什么时候都那么耀眼……啊，导师早上好。",loopType=1,cuename="v_faniya_s_09",sheetName="media/audio/CV/Role/Faniya/v_faniya_system",sheetNameawb="media/audio/CV/Role/Faniya/v_faniya_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2001109"]={id=2001109,name="【法尼亚秘书】需要处理的事务我已经整理好了，（笑，神色温柔）导师，您辛苦了。",loopType=1,cuename="v_faniya_s_10",sheetName="media/audio/CV/Role/Faniya/v_faniya_system",sheetNameawb="media/audio/CV/Role/Faniya/v_faniya_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2001110"]={id=2001110,name="【法尼亚秘书】（叹气）头发又翘起来了啊……",loopType=1,cuename="v_faniya_s_11",sheetName="media/audio/CV/Role/Faniya/v_faniya_system",sheetNameawb="media/audio/CV/Role/Faniya/v_faniya_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2001111"]={id=2001111,name="【法尼亚秘书】我（——沉思）有帮上导师的忙么？",loopType=1,cuename="v_faniya_s_12",sheetName="media/audio/CV/Role/Faniya/v_faniya_system",sheetNameawb="media/audio/CV/Role/Faniya/v_faniya_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2001112"]={id=2001112,name="【法尼亚秘书】有的时候我也很疑惑为什么我拥有如此充沛的源能，或许，导师可以找到答案？",loopType=1,cuename="v_faniya_s_13",sheetName="media/audio/CV/Role/Faniya/v_faniya_system",sheetNameawb="media/audio/CV/Role/Faniya/v_faniya_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2001113"]={id=2001113,name="【法尼亚秘书】世界树总是闪烁着耀眼的光，那种光……（内心os：那种光怕不是其实就是带来毁灭的东西，但是姐姐以前说那个是希望，好纠结啊）不，没什么。",loopType=1,cuename="v_faniya_s_14",sheetName="media/audio/CV/Role/Faniya/v_faniya_system",sheetNameawb="media/audio/CV/Role/Faniya/v_faniya_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2001114"]={id=2001114,name="【法尼亚秘书】斯露德们都拥有无与伦比的歌喉，希望有一天她们的歌声能够自由响彻在这片天空之下，没有厌弃，不会带来灾厄，只是歌者在放声歌唱。",loopType=1,cuename="v_faniya_s_15",sheetName="media/audio/CV/Role/Faniya/v_faniya_system",sheetNameawb="media/audio/CV/Role/Faniya/v_faniya_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2001115"]={id=2001115,name="【法尼亚秘书】导师，您知道飞鱼的习性么，这些小家伙会在野花盛开的季节聚集起来，去寻找源能密集的地方繁衍生息。也就是说，如果源能海面继续下降的话，它们就要无家可归了……所以为了飞鱼们，请尽快行动吧。",loopType=1,cuename="v_faniya_s_16",sheetName="media/audio/CV/Role/Faniya/v_faniya_system",sheetNameawb="media/audio/CV/Role/Faniya/v_faniya_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2001116"]={id=2001116,name="【法尼亚秘书】导师导师，看我雕刻的小飞鱼！谁教我的木雕？嘿嘿，是、秘、密、哦~",loopType=1,cuename="v_faniya_s_17",sheetName="media/audio/CV/Role/Faniya/v_faniya_system",sheetNameawb="media/audio/CV/Role/Faniya/v_faniya_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2001117"]={id=2001117,name="【法尼亚秘书】等到这个世界停止憎恨的那一天，如果，真的有那样一天的话，我（停顿——内心os：卧槽好紧张，要不要说呢）有一个请求……（内心os：还是好紧张，说不说呢？啧，说吧！），您愿意听听我的愿望么，导师?",loopType=1,cuename="v_faniya_s_18",sheetName="media/audio/CV/Role/Faniya/v_faniya_system",sheetNameawb="media/audio/CV/Role/Faniya/v_faniya_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2001118"]={id=2001118,name="【法尼亚秘书】哼~哼~哼~哼~哼~哼~……咿呀！导师什么时候出现在背后的！我的生日？非常感谢，总感觉，有些开心。",loopType=1,cuename="v_faniya_s_19",sheetName="media/audio/CV/Role/Faniya/v_faniya_system",sheetNameawb="media/audio/CV/Role/Faniya/v_faniya_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2001119"]={id=2001119,name="【法尼亚秘书】祝您生日快乐，这真是一件值得庆祝的事情，大家都很开心啊，像纪念日一样（前面都是客套话，因为太害羞了，从来没经历过这种事情，没给别人庆祝过生日，不知道怎么祝福导师）……是不是设立成节日会更好呢？唔……",loopType=1,cuename="v_faniya_s_20",sheetName="media/audio/CV/Role/Faniya/v_faniya_system",sheetNameawb="media/audio/CV/Role/Faniya/v_faniya_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2001120"]={id=2001120,name="【法尼亚秘书】（温柔，担忧）导师，该休息了，其他的事交给我就好。",loopType=1,cuename="v_faniya_s_21",sheetName="media/audio/CV/Role/Faniya/v_faniya_system",sheetNameawb="media/audio/CV/Role/Faniya/v_faniya_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2001121"]={id=2001121,name="【法尼亚秘书】是您！（给孩子激动地快哭了）您终于回来了，导师，欢迎回来。",loopType=1,cuename="v_faniya_s_22",sheetName="media/audio/CV/Role/Faniya/v_faniya_system",sheetNameawb="media/audio/CV/Role/Faniya/v_faniya_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
