    ["2002105"]={id=2002105,name="【奈娜秘书】就算让我留在这里偷懒，工钱我可是照收不误的。",loopType=1,cuename="v_naina_s_06",sheetName="media/audio/CV/Role/Naina/v_naina_system",sheetNameawb="media/audio/CV/Role/Naina/v_naina_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2002106"]={id=2002106,name="【奈娜秘书】ZZZZ……唔……啊，风太舒服一不小心就睡着了。",loopType=1,cuename="v_naina_s_07",sheetName="media/audio/CV/Role/Naina/v_naina_system",sheetNameawb="media/audio/CV/Role/Naina/v_naina_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2002107"]={id=2002107,name="【奈娜秘书】喂，喂……你不会真的睡着了吧导师？",loopType=1,cuename="v_naina_s_08",sheetName="media/audio/CV/Role/Naina/v_naina_system",sheetNameawb="media/audio/CV/Role/Naina/v_naina_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2002108"]={id=2002108,name="【奈娜秘书】这会儿的阳光可真是让人犯困。是吧？",loopType=1,cuename="v_naina_s_09",sheetName="media/audio/CV/Role/Naina/v_naina_system",sheetNameawb="media/audio/CV/Role/Naina/v_naina_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2002109"]={id=2002109,name="【奈娜秘书】竟然会让我来帮你，你这人还真是随便啊。这部分记得算入工钱啊，我去那边待着，有事了再叫我。",loopType=1,cuename="v_naina_s_10",sheetName="media/audio/CV/Role/Naina/v_naina_system",sheetNameawb="media/audio/CV/Role/Naina/v_naina_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2002110"]={id=2002110,name="【奈娜秘书】哟，你带了不少好吃的嘛，我就不客气了啊。",loopType=1,cuename="v_naina_s_11",sheetName="media/audio/CV/Role/Naina/v_naina_system",sheetNameawb="media/audio/CV/Role/Naina/v_naina_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2002111"]={id=2002111,name="【奈娜秘书】那群家伙怎么每次见到我都躲得远远的?我有那么可怕吗？",loopType=1,cuename="v_naina_s_12",sheetName="media/audio/CV/Role/Naina/v_naina_system",sheetNameawb="media/audio/CV/Role/Naina/v_naina_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2002112"]={id=2002112,name="【奈娜秘书】将源能像这样汇聚，然后“嘭”的一下发射出去就可以了……这样做不对么？就算你说不对也没有用，这可是很久以前有个整天笑嘻嘻的家伙教我的啦。",loopType=1,cuename="v_naina_s_13",sheetName="media/audio/CV/Role/Naina/v_naina_system",sheetNameawb="media/audio/CV/Role/Naina/v_naina_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2002113"]={id=2002113,name="【奈娜秘书】我一直都在帮卡娜莉亚收集她需要的材料，作为报酬，她会给我提供我需要的道具，这可不是什么秘密交易。有了这些小道具，就算是源能不如其他人的我也还是能够收拾掉这些异生体的。",loopType=1,cuename="v_naina_s_14",sheetName="media/audio/CV/Role/Naina/v_naina_system",sheetNameawb="media/audio/CV/Role/Naina/v_naina_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2002114"]={id=2002114,name="【奈娜秘书】在黑街那个地方，能够活下来已经是一种奢望，黑硬的面包，无处躲藏的街道，残破的建筑物，冻死饿死也不过是家常便饭。那里的人为什么不去其他地方？当然想啊，可被抛弃的人怎么会有家呢。",loopType=1,cuename="v_naina_s_15",sheetName="media/audio/CV/Role/Naina/v_naina_system",sheetNameawb="media/audio/CV/Role/Naina/v_naina_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2002115"]={id=2002115,name="【奈娜秘书】导师，帮我递一下那边的钳子。好嘞，今天的保养工作搞定。嗯？这些可都是保命的东西，不好好保养可是会出大问题的！",loopType=1,cuename="v_naina_s_16",sheetName="media/audio/CV/Role/Naina/v_naina_system",sheetNameawb="media/audio/CV/Role/Naina/v_naina_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2002116"]={id=2002116,name="【奈娜秘书】有的时候你也别那么拼命，还是稍微爱惜一下自己的身体吧，人一旦没命就什么也做不了了，这种道理用不着我来告诉你吧。",loopType=1,cuename="v_naina_s_17",sheetName="media/audio/CV/Role/Naina/v_naina_system",sheetNameawb="media/audio/CV/Role/Naina/v_naina_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2002117"]={id=2002117,name="【奈娜秘书】这枚硬币？是一位对我很重要的人给我的。每个人总有一两件特别的东西吧，或许有一天我会把这枚硬币的故事讲给你听，但不是现在。",loopType=1,cuename="v_naina_s_18",sheetName="media/audio/CV/Role/Naina/v_naina_system",sheetNameawb="media/audio/CV/Role/Naina/v_naina_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2002118"]={id=2002118,name="【奈娜秘书】问我有什么想要的礼物？为什么突然……啊！今天是我生日啊。",loopType=1,cuename="v_naina_s_19",sheetName="media/audio/CV/Role/Naina/v_naina_system",sheetNameawb="media/audio/CV/Role/Naina/v_naina_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2002119"]={id=2002119,name="【奈娜秘书】喂，今天是你的生日吧，生日快乐。哈？礼物？那种东西我没有准备啦。什么？维拉那家伙竟然也送了礼物？！唔……唔，那这个小玩意儿送给你好啦，这可是我的珍藏品！",loopType=1,cuename="v_naina_s_20",sheetName="media/audio/CV/Role/Naina/v_naina_system",sheetNameawb="media/audio/CV/Role/Naina/v_naina_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2002120"]={id=2002120,name="【奈娜秘书】你怎么还在研究怎么战斗啊，一炮全部轰飞不就好了。",loopType=1,cuename="v_naina_s_21",sheetName="media/audio/CV/Role/Naina/v_naina_system",sheetNameawb="media/audio/CV/Role/Naina/v_naina_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
    ["2002121"]={id=2002121,name="【奈娜秘书】唷，来啦。……先说清楚啊，你的零食被我吃光了，就算怪我也没用啊。",loopType=1,cuename="v_naina_s_22",sheetName="media/audio/CV/Role/Naina/v_naina_system",sheetNameawb="media/audio/CV/Role/Naina/v_naina_system",cuenamemale="",sheetNamemale="",sheetNameawbmale="",volume=1.0,is3DPos=0,fadeInTime=0.0},
